import React, { Component, Fragment } from 'react';
import {BrowserRouter as Router, Route} from "react-router-dom"
import NavBar from "./components/NavBar"

class App extends Component {
  render() {
    return (
      <Router>
        <NavBar />
      </Router>
    );
  }
}

export default App;
